import React from 'react';
import '../styles.css';

function Square(props) {
    if(props.value === 0) {
        return (
            <div className="empty-square"></div>
        );
    }
    else {
        return (
            <div className={props.class}>
                <p >
                    {props.value}
                </p>
            </div>
        );
    }
}

export default Square;
